import React from "react";
import styled from "styled-components";
import { MdFilterAlt, MdFilterAltOff } from "react-icons/md";

export const FilterBar = () => {
  return (
    <Container>
      <div className="btn_filter">
        <button>
          <MdFilterAlt />
        </button>
      </div>
    </Container>
  );
};

const Container = styled.div`
  width: 80%;
  height: 100%;
  display: flex; 
`;
